import './App.css';
import { Greet } from './Components/Greet';

function App() {
  return (
    <div className="App">
      <Greet  name='Komal' messageCount={10} isLoggedIn={false}/>
      <Person firstName='Komal' lastName='Panchal'></Person>
    </div>
  );
}

export default App;
